import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const Columns = () => {
  return (
    <Container>
      <Row>
        <Col sm={12} md={4}>
          <div>No Implementado</div>
        </Col>
        <Col sm={12} md={4}>
          <div>Contenido de la columna 2</div>
        </Col>
        <Col sm={12} md={4}>
          <div>Contenido de la columna 3</div>
        </Col>
      </Row>
    </Container>
  );
};

export default Columns;
